export const getUserTypeFromStorage = () => {
    
    let userInfo = JSON.parse(sessionStorage.getItem('userInfo'));

    if (userInfo !== null) {

        if (userInfo.userType !== undefined) {
            
            return userInfo.userType;
        }
    }
}
